import { plantList } from "../datas/plantList"

function ShoppingList(){
    const category = plantList.reduce(
        (acc, plant) => acc.include(plant.category) ? acc : acc.concat(plant.category),
        []
    )
    return(
       <div>
           <ul>
                {
                    category.map()
                }
           </ul>
           <ul>

           </ul>
       </div>
    )
}

export default ShoppingList
